import Layout from '../components/MyLayout';
import Head from 'next/head';

export const config = { amp: true };

function HomePage() {
  return (
    <Layout>
      <main>
        <Head>
          <script async custom-element="amp-form" src="https://cdn.ampproject.org/v0/amp-form-0.1.js"
            />
          <script async custom-template="amp-mustache" src="https://cdn.ampproject.org/v0/amp-mustache-0.2.js"></script>
        </Head>

          <h1>Hi! 👋🏾 My name is Naina!</h1>
          <br/>
          <div>
            This is my blog! Welcome!
            What will I write about you ask? I don't know yet. 
            I am practicing social isolation and have this domain so 🤷🏾.
          </div>          
          <br/>
          <div>
            <b>Some random facts about me:</b>
            <ul>
              <li>I'm Pakistani 🇵🇰.</li>
              <li>I live in the Bay Area in California.</li>
              <li>I love reading! Ask me about my love for <a href="https://www.goodreads.com/book/show/7201.As_the_Crow_Flies">As The Crow Flies by Jeffrey Archer</a></li>
              <li>I spend my weekends currently in self isolation learning how to bake, cook and play the keyboard!</li>
              <li>My sourdough starter is called Dough-lly Parton.</li>
            </ul>
          </div>
          <div className="signup">
            <form action-xhr="https://app.us20.list-manage.com/subscribe/post?u=c27d0495837c8265254d742b4&amp;id=c0a007ee8f" method="post" class="validate" target="_blank">
              <label for="mce-EMAIL">
                <b>Subscribe to my monthly newsletter</b>
              </label>
              <br/>
              <input type="email" value="" name="EMAIL" class="email" id="mce-EMAIL" placeholder="Email" required></input>
              <div className="dummy" aria-hidden="true">
                <input type="text" name="b_c27d0495837c8265254d742b4_c0a007ee8f" tabindex="-1" value=""></input>
              </div>
              <div class="clear">
                <input type="submit" value="Subscribe" name="subscribe" class="button"></input>
              </div>
              <div submit-success>
                <template type="amp-mustache">
                  Success! Thanks for signing up for my newsletter!
                </template>
              </div>
              <div submit-error>
                <template type="amp-mustache">
                  {`{{#verifyErrors}}`}
                    <p>{`{{message}}`}</p>
                  {`{{/verifyErrors}}`}
                  {`{{^verifyErrors}}`}
                    <p>Something went wrong. Try again later?</p>
                    {`{{/verifyErrors}}`}
                  <p>Submission failed</p>
                </template>
              </div>                 
            </form>
          </div>
      </main>
    <style jsx>{`
    @font-face {
        font-family: 'Bai Jamjuree';
        font-style: sans-serif;
        src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
    }
    * {
        font-family: 'Bai Jamjuree', sans-serif;
        text-decoration: none;
    }
    h1 {
        color:#d8156e;
    }
    main {
      position: fixed;
      margin: 0;
      color: #333333;
      top: calc(50% - 16px);
      left: 50%;
      transform: translate(-50%, -50%);
      padding-left:10px;
    }
    @media only screen and (max-width: 768px) {
      main {
        top: 5.5em;
        left: 1em;
        transform: translate(0%, 0%);
        padding-left:0px;
      }  
    }
    .signup {
      background:#fff; 
      clear:left; 
      font:14px; 
      width:100%;
      display: inline;
    }
    .dummy {
      position: absolute;
      left: -5000px;
    }
    form.amp-form-submit-success > input {
      display: none
    }

  `}</style>
    </Layout>
  );
}

export default HomePage;
